export default function TopicsPage() {
    let eventToSend = (e) => {
        let valueToSend = {
            topic: e.target.text
        }
        const options = {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(valueToSend)
        };
        fetch('/topics', options)
            .then((response) => response.json())
